import React, { useState } from 'react';
import '../css/navbar.css'; // Assuming you have a CSS file for styling

export default function Navbars() {
  const [isMenuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => {
    setMenuOpen(!isMenuOpen);
  };

  return (
    <div>
      <div className={`site-navbar site-navbar-target js-sticky-header ${isMenuOpen ? 'menu-open' : ''}`}>
        <div className="container">
          <div className="row align-items-center">
            <div className="col-2">
              <h1 className="my-0 site-logo"><a href="index.html">Brand</a></h1>
            </div>
            <div className="col-10">
              <nav className="site-navigation text-right" role="navigation">
                <div className="container">
                  <div className="d-inline-block d-lg-none ml-md-0 mr-auto py-3">
                    <a href="#" className="site-menu-toggle js-menu-toggle text-white" onClick={toggleMenu}>
                      <span className="icon-menu h3"></span>
                    </a>
                  </div>
                  <div className="openMenu" onClick={toggleMenu}>
                    <i className="fa fa-bars"></i>
                  </div>

                  <ul className={`site-menu main-menu js-clone-nav d-none d-lg-block ${isMenuOpen ? 'menu-open' : ''}`}>
                  <ul class="site-menu main-menu js-clone-nav d-none d-lg-block">

<li class="active"><a href="#home-section" class="nav-link">Home</a></li>
<li class="has-children">
  <a href="#" class="nav-link">Pages</a>
  <ul class="dropdown arrow-top">
    <li><a href="#" class="nav-link">Home</a></li>
    <li><a href="#" class="nav-link">List of Products</a></li>
    <li><a href="#" class="nav-link">Contact</a></li>
    <li><a href="#" class="nav-link">Contact</a></li>

    <li class="has-children">
      <a href="#">More Links</a>
      <ul class="dropdown">
        <li><a href="#">Menu One</a></li>
        <li><a href="#">Menu Two</a></li>
        <li><a href="#">Menu Three</a></li>
      </ul>
    </li>
  </ul>
</li>

<li><a href="#gallery-section" class="nav-link">Sign up</a></li>
<li><a href="#contact-section" class="nav-link">Log in</a></li>
<div class="closeMenu"><i class="fa fa-times"></i></div>

</ul>

                    <div className="closeMenu" onClick={toggleMenu}>
                      <i className="fa fa-times"></i>
                    </div>
                  </ul>
                </div>
              </nav>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}








